  false,\n\t\"url\": null,\n\t\"notes\": \"This plan documents and prioritizes inventory
  and monitoring surveys and research currently conducted, and proposed to be conducted
  at the Morris Wetland Management District from 2015 through 2029. This document
  was developed in collaboration with the Serviceu2019s Inventory and Monitoring Initiative,
  and in accordance with revised Service policy 701 FW 2. This Inventory and Monitoring
  Plan (IMP) documents natural resource surveys that will be conducted at Morris Wetland
  Management District (WMD) from 2015 through 2029, or until the refuge Comprehensive
  Conservation Plan (CCP), Habitat Management Plan (HMP), or this IMP are revised.
  The majority of surveys considered in this plan address resource management objectives
  identified in the Districtu2019s HMP (2012). Other surveys are a continuation of
  past monitoring conducted for tracking long-term trends in specific resources, understanding
  ecological interactions, or are part of regional and national survey efforts. This
  IMP was developed according to the Inventory and Monitoring (I&M) policy (701 FW
  2) for the National Wildlife Refuge System.\",\n\t\"license_title\": \"License Not
